import React from "react";

const images = ["AGUALIMPAVIDAPLENA.JPG", "ARTEPELOFUTURO.jpg", "CONCIENTIZACAOAMBIENTAL.jpg", "GUARDIAOAGUAS.jpeg", "MANGUEVIVO.jpg", "MULTIRAOVERDE.jpg", "RIOFUTUROICON2.png", "RIOPROFUTUROICONES.ico", "RIOSE1.JPG", "RIOSE2.jpg", "RiosProFuturoLOGO.png"];

export default function Gallery() {
  return (
    <section id="gallery" className="gallery-section">
      <h2>Galeria</h2>
      <div className="gallery-grid">
        {images.map((img) => (
          <figure key={img} className="gallery-item">
            <img src={`/images/${img}`} alt={img} />
          </figure>
        ))}
      </div>
    </section>
  );
}
